import React from 'react';
import styled from 'styled-components';


const Nav = () => {
  return (
    <Wrapper>
      
       <span>PROJECTS</span>
        <span>ABOUT</span>
        <span>CONTACT</span>
    </Wrapper>
  )
}
const Wrapper = styled.nav`
  position: fixed;
  display: flex;
  justify-content: space-evenly;
  align-items: center;
  bottom: 0px;
  height: 10vh;
  width: 100vw;
  z-index: 1000;
  background-color: #9FD9AD;
`;

export default Nav;
